%spark

val trainingSummary1 = rModel1.summary

// Obtain the objective per iteration.
val objectiveHistory1 = trainingSummary1.objectiveHistory
objectiveHistory1.foreach(loss => println(loss))

// Obtain the metrics useful to judge performance on test data.
// We cast the summary to a BinaryLogisticRegressionSummary since the problem is a
// binary classification problem.
val binarySummary1 = trainingSummary1.asInstanceOf[BinaryLogisticRegressionSummary]

// Obtain the receiver-operating characteristic as a dataframe and areaUnderROC.
val roc1 = binarySummary1.roc
roc1.show()
roc1.createOrReplaceTempView("roc1")
println(binarySummary1.areaUnderROC)

// Set the model threshold to maximize F-Measure
val fMeasure = binarySummary1.fMeasureByThreshold
val maxFMeasure = fMeasure.select(max("F-Measure")).head().getDouble(0)
val bestThreshold = fMeasure.where($"F-Measure" === maxFMeasure)
  .select("threshold").head().getDouble(0)
rModel1.setThreshold(bestThreshold)


